      Atom__c:
        '<p>Return to the <a href="https://www.export.gov/eCommerce" target="_blank">eCommerce Export Resource Center</a><br><br><a href="https://export.gov/ecommerce" target="_blank"><img alt="eCommerce Innovation Lab Logo, visit https://export.gov/ecommerce for more information!" src="https://trade--c.na21.content.force.com/servlet/rtaImage?eid=ka7t0000000Gn4Y&amp;feoid=00Nt0000000SZI2&amp;refid=0EMt0000000C41c"></img></a></p>\n\n<h3>About the eCommerce Innovation Lab</h3>\n\n<p><br>The eCommerce Innovation Lab began in late 2017 to help US business by identifying export opportunities across the <a href="https://www.export.gov/article?id=Choosing-an-eCommerce-Sales-Channel-Mix" target="_blank">ecommerce sales channels</a>, through concentration on client <a href="https://www.export.gov/article?id=eCommerce-Digital-Strategy" target="_blank">digital strategy development</a>, use of Website Globalization Review gap analysis tools, and the online <a href="https://www.export.gov/eCommerce" target="_blank">eCommerce Export Resource Center</a> business library to help companies adapt and grow in the digital economy.</p>\n\n<p>Please follow the links here for information regarding consumer online data protection regulations, such as the <a href="https://www.export.gov/article?id=EU-NEW-DATA-PRIVACY-LEGISLATION-GDPR" target="_blank">General Data Protection Regulation (GDPR)</a> for the EU, and the associated <a href="https://www.export.gov/article?id=General-FAQs" target="_blank">US/EU Privacy Shield Program</a> for US businesses.<br><br>Are you experiencing a trade barrier such as unfair customs rules or taxation in your destination market?  The <a href="https://tcc.export.gov/" target="_blank">Trade Compliance Center</a> is your go-to resource for ensuring existing international trade agreements deliver on your market access and fair treatment as promised, however if you are experiencing foreign-government imposed barriers to your in-market sales immediately <a href="https://2016.export.gov/usoffices/index.asp" target="_blank">contact a Local International Trade Specialist</a> near you to help get with an official resolution in a time-sensitive sales situation.</p>\n\n<p>If you have any questions, or would like free 1 on 1 counselling from an International Trade Specialist on your export strategy or <a href="https://www.export.gov/article?id=Why-Companies-should-export" target="_blank">cross-border ecommerce sales channel approach</a>, please contact <b><i>James.Bledsoe @ Trade.gov</i></b> to get connected to your local expert today!</p>',
      FirstPublishedDate: '2017-05-26T12:23:13.000+0000',
