        '<a href="http://www.export.gov/article?id=About-the-eCommerce-Innovation-Lab" target="_blank">http://www.export.gov/article?id=About-the-eCommerce-Innovation-Lab</a>',
      References__c:
        'Prepared by our U.S. Embassies abroad.  With its network of 108 offices across the United States and in more than 75 countries, the U.S. Commercial Service of the U.S. Department of Commerce utilizes its global presence and international marketing expertise to help U.S. companies sell their products and services worldwide. Locate the U.S. Commercial Service trade specialist in the U.S. nearest you by visiting http://export.gov/usoffices.',
      Summary:
        "This page contains information about the eCommerce Innovation Lab (EIL), the official resource for US businesses looking to optimize their digital strategy for the ecommerce sales channels. Please visit our office's online home at the eCommerce Export Resource Center for online sales guidance, market research, and cross-border ecommerce strategies.",
